# Tipo de dado boll (boolean)
# Ao questionar algo em um programa, só existem duas 
# respostas possíveis:
# sim(True) ou false(False).
# Esixtem vários operadores para "questionar".
# Dentre eles o ==, que é um operador lógico que 
# questiona se um valor é igual a outro.
print(10 == 10) # True => Verdadeiro
print(11 == 10) # False => Falso
print(type(True)) 
print(type(False)) 
print(type(10 == 10)) 
print(type(11 == 10)) 
